    false,nt"url": null,nt"notes": "This management plan provides a framework
    or set of guidelines providing for a sustainable black-tailed prairie dog population
    at Rocky Mountain Arsenal National Wildlife refuge (AMA). The plan describes the
    ecological significance of this species, the historical (mostly recent) trends in
    prairie dog distribution and abundance at AMA, past and current management practices,
    and present and future management conflicts. The plan also proposes a set of management
    criteria or designations for some areas of the refuge that will guide future management
    and more easily resolve some of these management conflicts.",nt"license_title":
